/**
 * RateVotable build a votable Rate element
 * @param {Object} settings
 * @param {String} settings.url for vote
 * @param {Boolen} settings.alreadyVoted if user already was voted
 * @param {Number} settings.vote user vote rate
 * @example
 * new CDQ.component.RateVotable({url: "http://urlForVote.com", vote: 4.5, al})
 * new CDQ.component.RateVotable({url: "http://urlForVote.com", alreadyVoted: true, vote: 4 })
 */
CDQ.component.RateVotable = CDQ.component.RateBase.extend({
	/**
	 * RateVotable Constructor
	 *
	 * @method init
	 * @param  {Object} settings receive an object that contains settings to be used.
	 */
	init: function (settings) {
		this.inherited().init(settings);
		this.setTheme('white');
		this.messageTimeout;
		this.settings.onRate = this.settings.onRate || function() {};

		if(this.settings.alreadyVoted) {
			this.oldVote = this.settings.vote;
		}
	},

	/**
	 * if user has touch it's set `lastStarTouched` and wait for a next click
	 * then if the vote is the same return true, otherwise false
	 * @overwrite
	 *
	 * @method shouldSubmitVote
	 */
	shouldSubmitVote: function(rating) {
		if(!Modernizr.touch) {
			return true;
		}

		if(this.round(this.lastStarTouched) === this.round(rating)) {
			return true;
		}

		this.$message.html(this.settings.label.tapAgainToSave);

		this.lastStarTouched = rating;
		return false;
	},

	/**
	 * Bind events
	 *
	 * @method bind
	 */
	bind: function() {
		var _this = this;

		this.$stars.on('mouseenter', function() {
			_this.$message.html('');
		});
	},

	/**
	 * Sets the rate initial state
	 *
	 * @method initialState
	 */
	initialState: function() {
		var alreadyVoted = this.settings.alreadyVoted;

		if(this.settings.votes === 0 || !alreadyVoted) {
			this.SET_DEFAULT_STAR_FLAG = true;
			this.displayHint(1);
			this.$stars.raty('click', 1);
		}

		if(alreadyVoted) {
			this.$title.html(this.settings.label.titleAfterVote);

			this.SET_DEFAULT_STAR_FLAG = true;
			this.displayHint(alreadyVoted);

			this.$stars
				.raty('click', this.settings.vote)
		}

		this.bind();
	},

	/**
	 * Displays message
	 *
	 * @method displayMessage
	 */
	displayMessage: function () {
		var self = this,
			messageDuration = this.settings.messageDuration;

		function remove() {
			self.$message.html('');
		}

		clearTimeout(this.messageTimeout);
		this.messageTimeout = setTimeout(remove, messageDuration);
	},

	/**
	 * Make the RateVotable unvotable and notify parent element
	 *
	 * @method submitVote
	 * @return {[type]} [description]
	 */
	submitVote: function (rating) {
		var self = this,
			settings = self.inherited().settings,
			id =  settings.id,
			url = settings.url,
			titleAfterVote = settings.label.titleAfterVote,
			data = {articleId: id, rating: rating};

		if(this.oldVote) {
			data.oldrating = this.oldVote;
		}

		jQuery.ajax({url: url, method: settings.method, dataType: 'json', data: data})
			.then(function(data) {
				self.$message.html(data.message);
				if(Number(data.status) === 1) {
					self.$title.html(titleAfterVote);

					self.settings.parent.trigger('rate.voted', data);
					self.lastStarTouched = false;
					self.SET_DEFAULT_STAR_FLAG = false;
					self.oldVote = rating;

					self.settings.onRate(settings.alreadyVoted, {rating: rating, id: data.articleId, votes: data.votes}); // GFL-392
					settings.alreadyVoted = true;
					return;
				}

			});
	},

	/**
	 * Displays hint
	 *
	 * @method displayHint
	 */
	displayHint: function(rating) {
		var tooltips = this.settings.label.tooltip;
		var message = '';

		if (rating !== null && rating > 0) {
			message = tooltips[Math.round(Number(rating) -1)];
		}

		this.$hint.html(message);
	}
});

/**
 * Setups teaser navegation item component
 *
 *	new CDQ.core.TeaserNavigationItem();
 *
 * @class TeaserNavigationItem
 * @constructor
 * @namespace component
 */
CDQ.component.TeaserNavigationItem = Class.extend({
	/**
	 * TeaserNavigationItem constructor
	 *
	 * @method init
	 * @param {Object} container Container object
	 * @param {Object} settings Component settings
	 */
	init: function(container, settings) {
		var $nav,
			data;

		this.timmer = 0;

		this.settings = settings;

		this.$container = container;
		data = this.$container.data(this.settings.data);
		$nav = this.$container.find(data);
		this.$navChildren = $nav.children();

		this.build();
		this.bind();
	},

	/**
	 * Bind events
	 *
	 * @method bind
	 */
	bind: function() {
		var _this = this;

		jQuery(window).resize(function() {
			clearTimeout(_this.timmer);

			_this.timmer = setTimeout(function() {

				_this.reset.apply(_this, [false]);
			}, 300);
		});


		this.$navChildren.click(function(event) {
			_this.click(event);
		});
	},

	/**
	 * Builds the teasers
	 *
	 * @method build
	 */
	build: function() {
		this.$teasers = this.$container.find(this.settings.teasersClass);

		this.$container.addClass('initialized');
		this.reset(true);
	},

	/**
	 * Resets the teasers
	 *
	 * @method reset
	 * @param {Boolean} shouldAnimate Boolean that defines if the teaser should animate
	 */
	reset: function(shouldAnimate) {
		var isLarge = CDQ.global.util.getViewportSize().width > CDQ.global.util.getBreakpoints('large'),
			_this = this;

		this.$navChildren.removeClass('active');
		this.$teasers.removeClass('active');

		if(isLarge) {
			this.$navChildren.first().addClass('active');
		}

		this.$teasers.removeClass('active');

		if(!shouldAnimate) {
			return;
		}

		this.$teasers.fadeOut(_this.settings.animation -200, function() {
			if(!isLarge) {
			}

			_this.$teasers
				.first()
				.fadeIn(_this.settings.animation)
				.addClass('active');
		});

	},

	/**
	 * Handles the click event
	 *
	 * @method click
	 * @param {Object} event Event object
	 */
	click: function(event) {
		var $item,
			index,
			active,
			isLarge = CDQ.global.util.getViewportSize().width > CDQ.global.util.getBreakpoints('large');

		$item = jQuery(event.currentTarget);

		if(!isLarge) {
			return $item.blur();
		}

		event.preventDefault();

		index = $item.index();

		$item.blur();

		this.$navChildren.removeClass('active');
		$item.addClass('active');

		active = this.$teasers.filter('.active')

		if(active.index() === index) {
			return;
		}

		active
			.removeClass('active')
			.fadeOut();

		this.$teasers
			.eq(index)
			.fadeIn(this.settings.animation)
			.addClass('active');
	}
});

